import React from "react";
import { StylesProvider } from '@material-ui/styles'
import { CssBaseline } from '@material-ui/core'
import globalSyle from "./commons/global-styles";

function App() {
  return (
    <StylesProvider injectFirst>
      <CssBaseline />
      <globalSyle />
      <div>
        teste
      </div>
    </StylesProvider>
  );
}

export default App;
